
DROP DATABASE gestaocarismat;
CREATE DATABASE gestaocarismat;

USE gestaocarismat;

SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

/*!40101 SET @OLD_CHARACTER_SET_CLIENT=@@CHARACTER_SET_CLIENT */;
/*!40101 SET @OLD_CHARACTER_SET_RESULTS=@@CHARACTER_SET_RESULTS */;
/*!40101 SET @OLD_COLLATION_CONNECTION=@@COLLATION_CONNECTION */;
/*!40101 SET NAMES utf8 */;


DELIMITER $$
CREATE DEFINER=`gestaocarismat`@`%` FUNCTION `regex_replace`(pattern VARCHAR(1000),replacement VARCHAR(1000),original VARCHAR(1000)) RETURNS varchar(1000) CHARSET latin1
    DETERMINISTIC
BEGIN 
 DECLARE temp VARCHAR(1000); 
 DECLARE ch VARCHAR(1); 
 DECLARE i INT;
 SET i = 1;
 SET temp = '';
 IF original REGEXP pattern THEN 
  loop_label: LOOP 
   IF i>CHAR_LENGTH(original) THEN
    LEAVE loop_label;  
   END IF;
   SET ch = SUBSTRING(original,i,1);
   IF NOT ch REGEXP pattern THEN
    SET temp = CONCAT(temp,ch);
   ELSE
    SET temp = CONCAT(temp,replacement);
   END IF;
   SET i=i+1;
  END LOOP;
 ELSE
  SET temp = original;
 END IF;
 RETURN temp;
END$$

DELIMITER ;


CREATE TABLE IF NOT EXISTS `agendamento` (
  `id` int(11) NOT NULL,
  `url` text,
  `data_envio` datetime DEFAULT NULL,
  `mensagem_id` int(11) DEFAULT NULL,
  `return` text,
  `success` int(11) DEFAULT NULL
);


CREATE TABLE IF NOT EXISTS `agendamentopendente` (
`cliente_id` int(10) unsigned
,`mensagem_id` int(10) unsigned
,`grupo_id` int(10) unsigned
,`contato_id` int(10) unsigned
,`mensagem` varchar(320)
,`envio` datetime
,`ds_nome` varchar(201)
,`aniversario` date
,`celular` varchar(1000)
,`campanha` varchar(100)
,`resposta` varchar(50)
,`operadora` varchar(20)
,`dt_envio_sms` datetime
,`status` varchar(20)
,`chave` varchar(15)
,`sucesso` int(10) unsigned
,`total` int(10) unsigned
,`erro` int(10) unsigned
);

CREATE TABLE IF NOT EXISTS categorias (
  id int(10) unsigned NOT NULL,
  parent_id int(10) unsigned DEFAULT NULL,
  cliente_id int(10) unsigned DEFAULT NULL,
  nome varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  tipo varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL
) ENGINE=MyISAM AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela de Categorias de Mensagens';


CREATE TABLE IF NOT EXISTS clientes (
  id int(10) unsigned NOT NULL,
  cnpj varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  nome varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  endereco varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  responsavel varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  email varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  telefone varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  sms_mes int(10) unsigned NOT NULL DEFAULT '0',
  seguimento varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  logo mediumblob,
  created datetime DEFAULT NULL,
  modified datetime DEFAULT NULL
) ENGINE=MyISAM AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela de Clientes';


CREATE TABLE IF NOT EXISTS configs (
  id int(11) NOT NULL,
  url varchar(255) DEFAULT NULL,
  padrao int(11) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;
CREATE TABLE IF NOT EXISTS `contatoporgrupo` (
`id` int(10) unsigned
,`cliente_id` int(10) unsigned
,`nome` varchar(255)
,`cor` varchar(7)
,`quantidade` bigint(21)
);

CREATE TABLE IF NOT EXISTS contatos (
  id int(10) unsigned NOT NULL,
  cliente_id int(10) unsigned NOT NULL,
  usuario_id int(10) unsigned NOT NULL,
  nome varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  sobrenome varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  telefone varchar(25) COLLATE utf8_unicode_ci NOT NULL,
  sexo char(1) COLLATE utf8_unicode_ci DEFAULT NULL,
  email varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  aniversario date DEFAULT NULL,
  filho char(1) COLLATE utf8_unicode_ci DEFAULT NULL,
  created datetime NOT NULL,
  modified datetime NOT NULL
) ENGINE=MyISAM AUTO_INCREMENT=5058 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela de Contatos';

