CREATE TABLE IF NOT EXISTS contatos_grupos (
  contato_id int(10) unsigned NOT NULL,
  grupo_id int(10) unsigned NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Relacionamento entre Contatos e Grupos';


CREATE TABLE IF NOT EXISTS grupos (
  id int(10) unsigned NOT NULL,
  parent_id int(10) unsigned DEFAULT NULL,
  cliente_id int(10) unsigned NOT NULL,
  usuario_id int(10) unsigned NOT NULL,
  nome varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  cor varchar(7) COLLATE utf8_unicode_ci NOT NULL,
  visivel char(1) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  tipo varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  created datetime NOT NULL,
  modified datetime NOT NULL
) ENGINE=MyISAM AUTO_INCREMENT=763 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela de Grupos';

CREATE TABLE IF NOT EXISTS `mensagemporcategoria` (
`id` int(10) unsigned
,`cliente_id` int(10) unsigned
,`nome` varchar(255)
,`quantidade` bigint(21)
,`total_sms` decimal(32,0)
);

CREATE TABLE IF NOT EXISTS mensagens (
  id int(10) unsigned NOT NULL,
  cliente_id int(10) unsigned NOT NULL,
  usuario_id int(10) unsigned NOT NULL,
  categoria_id int(10) unsigned NOT NULL,
  mensagem varchar(320) COLLATE utf8_unicode_ci NOT NULL,
  envio datetime NOT NULL,
  total int(10) unsigned DEFAULT NULL,
  sucesso int(10) unsigned DEFAULT '0',
  erro int(10) unsigned DEFAULT '0',
  campanha int(10) unsigned DEFAULT NULL,
  created datetime DEFAULT NULL,
  modified datetime DEFAULT NULL
) ENGINE=MyISAM AUTO_INCREMENT=645 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela de Mensagens de SMS';


CREATE TABLE IF NOT EXISTS mensagens_grupos (
  mensagem_id int(10) unsigned NOT NULL,
  grupo_id int(10) unsigned NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela de Grupos da Mensagem';


CREATE TABLE IF NOT EXISTS retornos (
  id int(10) unsigned NOT NULL,
  cliente_id int(10) unsigned NOT NULL,
  mensagem_id int(10) unsigned NOT NULL,
  grupo_id int(10) unsigned NOT NULL,
  contato_id int(10) unsigned DEFAULT NULL,
  campanha varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  celular varchar(15) COLLATE utf8_unicode_ci NOT NULL,
  resposta varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  operadora varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `data` datetime DEFAULT NULL,
  `status` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  chave varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL,
  created datetime DEFAULT NULL,
  modified datetime DEFAULT NULL
) ENGINE=MyISAM AUTO_INCREMENT=3388 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela com Retornos dos Envios';

CREATE TABLE IF NOT EXISTS `smsporgrupo` (
`cliente_id` int(10) unsigned
,`grupo_id` int(10) unsigned
,`nome` varchar(255)
,`cor` varchar(7)
,`mes` varchar(2)
,`ano` varchar(4)
,`quantidade` bigint(21)
);

CREATE TABLE IF NOT EXISTS templates (
  id int(10) unsigned NOT NULL,
  cliente_id int(10) unsigned NOT NULL,
  mensagem varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  tipo varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  created datetime NOT NULL,
  modified datetime NOT NULL
) ENGINE=MyISAM AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela de Templates para Mensagens';


CREATE TABLE IF NOT EXISTS usuarios (
  id int(10) unsigned NOT NULL,
  cliente_id int(10) unsigned DEFAULT NULL,
  nome varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  username varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  role varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  last_login datetime DEFAULT NULL,
  created datetime DEFAULT NULL,
  modified datetime DEFAULT NULL
) ENGINE=MyISAM AUTO_INCREMENT=150 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tabela de Usuários';

